textOriginal:
boa noite senhores; familiares; colaboradores;

esse careca maldito; é a figura de satanás; dos contos; só falta avermelhar os oios e os chifres na testa;

que asqueroso; e cia.

seja o fim das trevas; especialmente; dos morcegos, adhocs; marginais.

bonanza; para todos homens e mulheres, mundo afora.

Novo Brasil, coração do mundo; pátria de amor por excelência; celeiro para humanidade;

Deus, extremamente feliz.

LULA
	Este senhor, ex PR, Lula, me ensinou muitas coisas, por isso até penso em votar nele novamente. Ele, analfabeto, segundo ele de pai e mãe, sem nunca ter lido um livro na vida, me ensinou como ser bandido, ladrão, corrupto, hipócrita, com uma retórica 171, cooptador de autoridades e parceiros pra cometer crimes e conseguiu sair ileso de tudo que fez de falcatruas. E ainda conseguiu enganar toda uma nação por tantos anos seguidos. Ou somos todos idiotas ou ele conseguiu hipnotizar os idiotas deste país maravilhoso. Seria preciso fazer vários cursos pra praticar tudo isso, uma retórica vencedora por  tantos anos e  ainda quer voltar? É um artista. Uma pessoa muito sábia. Uma Sabichona. Um jegue sem qualidades.
	Lula é um animal político sem limites, sem escrúpulos, sem compaixão ou moral e ética A única verdade que vale é a dele. Teve a capacidade de ir ao Vaticano pedir perdão, mas, não quis reconhecer as atrocidades que cometeu ao lado do grupo que comandou a pilhagem desenfreada no Brasil nos últimos 40 anos. E ainda é um cara de pau querendo voltar e ainda tens uns idiotas que o adoram. 
	Admiro tanto este senhor que lhe fiz uma poesia com rimas:
	Nasci no sertão;
	Fui um chorão;
	Menti de montão;
	Inventei o mensalão;
	Lasquei o povão;
	Roubei a nação;
	Fraudei a eleição;
	Desviei um trilhão;
	Alimentei e disseminei a corrupção;
	Montei um quadrilhão;
	Iniciei o Petrolão;
	Roubei todos os fundos de pensão;
	Andei de camburão;
	Fui parar na prisão;
	Porque virei um ladrão;
	E fiquei caladão;
	Mas, comprei a isenção; com o favor do meu amigão;
	Hoje me sinto um homem honesto; nunca houve no mundo um homem mais honesto do que eu não;
	Mas, na verdade sou um cagão;
	Um grande espertalhão que fudeu toda uma Nação.	

	Ele enganou até o Papa, foi ao Papa pedir perdão, mas, não confessou seus crimes. Saiu do Vaticano se achando o Papa, pois,  todas as obra que fez os anos que governou ele levou um terço junto. E a partir dai se achou sem pecados nenhum o que corroborou com o vexame do STF que por uma filigrama jurídica devolveu seus processos à primeira instância, ocorrendo a prescrição da maioria deles.

	“A injustiça em qualquer lugar é uma ameaça à justiça em todo lugar. ”Martin Luther King

	Depois do Governo do PT, conclui que os dois presidentes de 2003 a 2018, são dois Zé Ninguém, o famoso Zé Ruela: 
	Não lê, não estuda, não sabe de música, não entende de arte, não tem curiosidade, não tem conhecimento, não tem empatia, não tem modos, não tem  educação, não tem respeito, não tem honra, não tem ética, não tem caráter, não tem lealdade, não tem história, nem um cachorro ele tem. 

	Não tem nada, mas, sobra desonestidade, roubalheira, corrupção de montão, cara de pau por fazer novamente um discurso retórico querendo enganar novamente todo o povo, enquanto tem alguns que idolatram este bandido e ainda acham que ele é honesto. Maldita ignorância.
	Este é senhor é surreal passou 14 anos governando o País, e entregou com um rombo de 4 trilhões, as estatais falidas, 4ª maior carga tributária do planeta, metade do País sem esgotos, , 1/4 da população na miséria, 12º País mais violento do mundo, os maiores casos de corrupção e ainda se coloca como solução. É um pândega. Perdeu toda a vergonha na cara. Depois de tudo que fez e  agora  ainda se acha o salvador da Pátria. 

	Eles vêem a verdade, ouvem a verdade, sabem da verdade e ainda acreditam nas mesmas mentiras deste idolatrado senhor. 
	O Socialismo de Lula é uma máquina de destruição em massa da classe operária e um sonho das elites dominantes para que possam se locupletar nos cofres públicos.  
	Este senhor sonha, na verdade, com a censura de seu próprio passado. Só que isto é impossível. E, ainda que as plataformas  bloqueiem as referências ao passado de delitos de Lula e do PT, a sociedade sabe a verdade.  (Guilherme Fiúza)
	Hoje quando ouço e vejo este senhor na TV falando que o povo vai voltar comer picanha, só os brasileiros ignorantes acreditam. Pobre nunca comeu picanha. E no Brasil pouca gente come picanha. Custa caro. A pegadinha que eu vejo o povo vai comer PICA ....nha do Lula.

	Candidato tem que ser alfabetizado, tem que ter ficha limpa, não pode ser ex presidiário, não pode incentivar vagabundos a invadir casas alheias e nem a roubar celular e nem incentivar o aborto. Candidato não podem ser corruptos,  nem bêbado, muito mais chefe que quadrilha, pairando ainda a dúvida com relação a sua união ao crime organizado. 

	Assim desejo a todos os esquerdistas do Brasil e do mundo: 
	O salário de Cuba, A liberdade da Coréia do Norte, A fartura da Venezuela e a justiça da China e da Coréia do Norte...

	 Este senhor fundou e organizou o Foro de São Paulo, e era seu Presidente, reunindo toda a esquerda do mundo, os seguintes Países  estão sofrendo as consequências, assim estão :o Perú, o Chile, a Argentina, a Guatemala, El Salvador, Nicarágua, a Colômbia e Honduras, e agora estão fazendo um esforço tremendo para tomar o poder no Brasil  e fundar só uma Nação de esquerda. Estaremos todos fudidos.

	Luiz Antônio Lima – Whatsapp: 69 981 076543
	Porto Velho – RO – 07.07.2022

